description:
For all you Elvis Presley fans out there!!



comment from imdb:

This award winning movie for best documentary is well worth a watch. Elvis doesn't look as good as before in it but his singing is better than ever. There is some great performances including 'An American Trilogy' and 'Johnny B. Goode'. It's amusing but ends sad. It was the last film by Elvis Presley and his only one to win an award. The rock 'n' roll is great on this video including his early songs including 'Blue suede shoes'. There is a great version of 'Love me Tender' and clips from his movies and this is what makes it sad , looking back on when Elvis looked better.
